import React, { useState } from 'react';

const VoterManagement = () => {
  const [formData, setFormData] = useState({
    cnic: '',
    name: '',
    email: '',
    phone: '',
    address: '',
    dateOfBirth: '',
    password: '',
    newPassword: '',
    newEmail: '',
    city: '',
    constituency: '',
    twoFactorCode: '',
  });
  const [token, setToken] = useState(null);
  const [message, setMessage] = useState('');

  const handleChange = (e) => {
    setFormData({ ...formData, [e.target.name]: e.target.value });
  };

  const handleSignup = async () => {
    try {
      const response = await fetch('/voter/signup', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify(formData),
      });
      const data = await response.json();
      setMessage(data.message);
    } catch (error) {
      console.error(error);
      setMessage('Error signing up');
    }
  };

  const handleLogin = async () => {
    try {
      const response = await fetch('/voter/login', {
        method: 'POST',
        headers: { 'Content-Type': 'application/json' },
        body: JSON.stringify({ cnic: formData.cnic, password: formData.password }),
      });
      const data = await response.json();
      if (data.token) {
        setToken(data.token);
      }
      setMessage(data.message);
    } catch (error) {
      console.error(error);
      setMessage('Error logging in');
    }
  };

  const handleUpdate = async () => {
    try {
      const response = await fetch('/voter/update', {
        method: 'PUT',
        headers: {
          'Content-Type': 'application/json',
          Authorization: `Bearer ${token}`,
        },
        body: JSON.stringify(formData),
      });
      const data = await response.json();
      setMessage(data.message);
    } catch (error) {
      console.error(error);
      setMessage('Error updating voter info');
    }
  };

  const handleVerify = async () => {
    try {
      const response = await fetch('/voter/verify', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          Authorization: `Bearer ${token}`,
        },
        body: JSON.stringify({ twoFactorCode: formData.twoFactorCode }),
      });
      const data = await response.json();
      setMessage(data.message);
    } catch (error) {
      console.error(error);
      setMessage('Error verifying voter');
    }
  };

  return (
    <div style={styles.container}>
      <h1>Voter Management</h1>
      <p>{message}</p>

      <div style={styles.formGroup}>
        <input
          type="text"
          name="cnic"
          placeholder="CNIC"
          value={formData.cnic}
          onChange={handleChange}
          style={styles.input}
        />
        <input
          type="text"
          name="name"
          placeholder="Name"
          value={formData.name}
          onChange={handleChange}
          style={styles.input}
        />
        <input
          type="email"
          name="email"
          placeholder="Email"
          value={formData.email}
          onChange={handleChange}
          style={styles.input}
        />
        <input
          type="text"
          name="phone"
          placeholder="Phone"
          value={formData.phone}
          onChange={handleChange}
          style={styles.input}
        />
        <input
          type="text"
          name="address"
          placeholder="Address"
          value={formData.address}
          onChange={handleChange}
          style={styles.input}
        />
        <input
          type="date"
          name="dateOfBirth"
          value={formData.dateOfBirth}
          onChange={handleChange}
          style={styles.input}
        />
        <input
          type="password"
          name="password"
          placeholder="Password"
          value={formData.password}
          onChange={handleChange}
          style={styles.input}
        />
      </div>

      <button onClick={handleSignup} style={styles.button}>Sign Up</button>
      <button onClick={handleLogin} style={styles.button}>Login</button>
      <button onClick={handleUpdate} style={styles.button}>Update Info</button>
      <button onClick={handleVerify} style={styles.button}>Verify</button>
    </div>
  );
};

const styles = {
  container: {
    maxWidth: '600px',
    margin: '0 auto',
    padding: '20px',
    textAlign: 'center',
    fontFamily: 'Arial, sans-serif',
  },
  formGroup: {
    marginBottom: '20px',
  },
  input: {
    display: 'block',
    width: '100%',
    padding: '10px',
    margin: '10px 0',
    border: '1px solid #ccc',
    borderRadius: '5px',
  },
  button: {
    padding: '10px 20px',
    margin: '10px',
    backgroundColor: '#007BFF',
    color: '#fff',
    border: 'none',
    borderRadius: '5px',
    cursor: 'pointer',
  },
};

export default VoterManagement;
